      <h1 className="text-3xl font-bold text-center text-gray-800 mb-4">Para Anguie Florez</h1>
      <p className="text-lg text-gray-600 text-center leading-relaxed">
        Cada latido de mi corazón lleva tu nombre. En cada línea de código que escribo, 
        encuentro una razón más para amarte. Eres mi bug favorito, ese que nunca quiero solucionar.
      </p>
      <p className="mt-6 text-pink-600 font-medium text-center">Con todo mi amor ❤️ att: tu amor jonathan valle</p>
    </div>
  );
};

export default MessageCard;
